'use strict';

var valid = [];
var test;

test = {
	'code': [
		'// VARIABLES //',
		'',
		'var E = exp( 1.0 );'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'// VARIABLES //',
		'',
		'var PI_SQUARED = PI*PI;'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'// VARIABLES //',
		'',
		'var PI_CUBED = pow( PI, 3.0 );'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'// VARIABLES //',
		'',
		'var out = Math.imul( -5, 12 );' // TODO: remove once an equivalent to `Math.imul` is present in the project
	].join( '\n' )
};
valid.push( test );


// EXPORTS //

module.exports = valid;
